import React, { useEffect, useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import { transporterAPI, orderAPI } from "../services/api";
import "./TransportDashboard.css";

const TransportDashboard = () => {
  const saved = JSON.parse(localStorage.getItem("transporter"));
  const navigate = useNavigate();

  const transporterId = saved?.id || saved?.transporterId || null;
  const [orders, setOrders] = useState([]);

  useEffect(() => {
    if (transporterId) {
      loadAssignedOrders(transporterId);
    } else {
      console.error("Transporter ID missing in localStorage!");
    }
  }, [transporterId]);

  const loadAssignedOrders = async (id) => {
    try {
      const res = await transporterAPI.getOrdersForTransporter(id);
      setOrders(res.data || []);
    } catch (err) {
      console.error("‚ùå Failed to load orders:", err);
    }
  };

  const updateStatus = async (orderId, status) => {
    try {
      const res = await orderAPI.updateTransportStatus(orderId, status);

      setOrders((prev) =>
        prev.map((o) => (o.orderId === orderId ? { ...o, ...res.data } : o))
      );
    } catch (err) {
      console.error("‚ùå Failed to update status:", err);
      alert("Failed to update delivery status");
    }
  };

  const handleBack = () => navigate("/transport/login");

  if (!transporterId) {
    return (
      <div className="transport-dashboard">
        <h2>No transporter logged in!</h2>
        <button className="back-btn" onClick={handleBack}>
          ‚¨Ö Back to Login
        </button>
      </div>
    );
  }

  return (
    <>
      {/* ‚≠ê Navbar */}
      <nav className="navbar">
        <div className="nav-brand">Product Tracking using Blockchain</div>  
        <div className="nav-links">
        </div>
      </nav>

      <div className="transport-dashboard">
        <button className="back-btn" onClick={handleBack}>‚¨Ö Back</button>

        <h1>üöö Transporter Dashboard</h1>
        <h3>Welcome, {saved?.name}</h3>

        {orders.length === 0 ? (
          <p className="no-orders">No assigned deliveries yet.</p>
        ) : (
          <div className="orders-list">
            {orders.map((order) => (
              <div className="order-card" key={order.orderId}>
                <h3>Order #{order.orderId}</h3>

                <p><b>Status:</b> {order.status}</p>
                <p><b>Farmer:</b> {order.farmerName || "Unknown"}</p>
                <p><b>Total Amount:</b> ‚Çπ{order.totalAmount}</p>

                <p><b>Vehicle:</b> {order.vehicleNo || "-"}</p>
                <p><b>Driver:</b> {order.driverName || "-"}</p>

                <div className="actions">
                  {order.status === "ASSIGNED_TO_TRANSPORTER" && (
                    <button
                      className="pickup-btn"
                      onClick={() => updateStatus(order.orderId, "OUT_FOR_DELIVERY")}
                    >
                      üöö Mark Picked Up
                    </button>
                  )}

                  {order.status !== "DELIVERED" && (
                    <button
                      className="deliver-btn"
                      onClick={() => updateStatus(order.orderId, "DELIVERED")}
                    >
                      ‚úî Mark Delivered
                    </button>
                  )}
                </div>
              </div>
            ))}
          </div>
        )}
      </div>
    </>
  );
};

export default TransportDashboard;
